// imort
import React, { Component } from 'react';
import  {Navbar}  from './components/Navbar';
import  Header  from './components/header';
import Main from './components/main';
import Footer from './components/footer';
//import picture
import bill_ from "./picture/billbord.JPG";
import my_push from "./picture/push.JPG";
import my_apil from "./picture/apill.JPG";

class App extends Component {
  constructor(){
    super()
    this.picture=[{id:1 , image:bill_},{id:2 , image:my_push},{id:3 , image:my_apil}]
    
  }
  render(){
    return(
        <div>
        <Navbar/>
        <Header/>
     {this.picture.map((p)=><Main picture={p.image} key={p.id} />)}
        <Footer/>
       </div>
    )
  }        
}

export default App;
